import quotes from '../../../assets/quotes.png';

const Reviews = () => {
  return (
    <div className="pt-20 bg-white">
      <div className="mx-auto grid place-items-center px-6 xl:px-20" style={{ maxWidth: '1550px' }}>
        <p className="uppercase tracking-wider text-center text-2xl xl:text-3xl font-semibold pb-3">
          10+ years in business
        </p>
        <img src={quotes} alt="" className="w-9 absolute top-[-5%] right-[58.8%]" />
        <p className="relative pt-6 text-2xl font-light tracking-wider">
          See what our clients <br /> have to say about us!
        </p>
      </div>
      <div>actual reviews</div>
    </div>
  );
};
export default Reviews;
